package com.sb.basic.arraybasics;
public class decrement_increment_operator {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int no=1;
		while(no<=3){
			int count=1;
		while(count<=5)
		{
			System.out.print(no + " ");
			count=count+1;
		}
		System.out.println(" ");
		no=no+1;
		}

	}

}
